import React from 'react';
import { useForm, SubmitHandler } from 'react-hook-form';

interface DashboardProps {
  logout: any;
  // register: any;
  // handleSubmit: any;
  // errors: any;
}

type Inputs = {
  name: string;
  email: string;
  password: string;
};

const Dashboard: React.FunctionComponent<DashboardProps> = ({ logout }) => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors }
  } = useForm<Inputs>();

  const onSubmit = (data: any) => {
    console.log(data);
  };

  return (
    <div>
      Dashboard
      <div>
        <form onSubmit={handleSubmit(onSubmit)}>
          <input defaultValue={'name'} {...register('name', { required: true })} />
          <input {...register('email', { required: true, pattern: /^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/ })} />
          {/* Password must be at least 4 to 8 characters and include one upper case, one lower case letter, and one numeric digit. */}
          <input {...register('password', { required: true, pattern: /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{4,8}$/ })} />
          {errors.password && <span>This field is required</span>}
          <button type="submit"> Create </button>
        </form>
      </div>
    </div>
  );
};

export default Dashboard;
